		String message = TestUtil.getReqMessage(userId, channelCode, body, cmd);
		System.out.println(cmd + "-to-" + message);
		
		//String content = HttpClientUtil.request(TestConfig.IP, TestConfig.PORT, TestConfig.PATH, message, HttpClientUtil.POST, param);
		
		String content = HttpClientUtil.request("www.mcp8.com", 80, "/mcp-filter/main/interface.htm", message, HttpClientUtil.POST, param);
		//String content = HttpClientUtil.request("192.168.1.148", 8080, "/mcp-filter/main/interface.htm", message, HttpClientUtil.POST, param);
		//String content = HttpClientUtil.request("210.14.146.180", 8401, "/mcp-filter/main/interface.htm", message, HttpClientUtil.POST, param);
	
		System.out.println(cmd + "-back-" + content);
		return content;
